const Confirmation = (props) => {
  console.log(props);
  return(
    <div className="container">
      <div className="row">
        <div className="container container--xs">
          <h1 className="mb-1 text-center">
            Thank you
          </h1>
          <div className="fs-14 text-gray text-center mb-5">
            <p>
              Thank you for upgrading, you can now manage your vendor account
            </p>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Confirmation;
